def run(value_list):
    """
    Calculates the percentage change in operating loss carryforward from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple containing the percentage change as a float (rounded to two decimal places) and the scale ('percent').
    """
    loss_2018 = None
    loss_2019 = None

    for item in value_list:
        if item['category'] == 'Opereating loss carryforward' and item['header2'] == '2018':
            loss_2018 = item['number_value']
        elif item['category'] == 'Opereating loss carryforword' and item['header2'] == '2019':
            loss_2019 = item['number_value']

    if loss_2018 is not None and loss_2019 is not None:
        percentage_change = ((loss_2019 - loss_2018) / loss_2018) * 100
        return (round(percentage_change, 2), 'percent')
    else:
        return (0.0, '')

